SELECT DISTINCT HL7EventMessageTypes.message_typ_snd as msg_type, HL7EventMessageTypes.event_code as evt_code, HL7EventMessageTypes.message_structure_snd as msg_struct FROM HL7Versions INNER JOIN HL7EventMessageTypes ON HL7Versions.version_id = HL7EventMessageTypes.version_id WHERE (((HL7EventMessageTypes.message_typ_snd)<>'NUL') AND ((HL7Versions.hl7_version)= ? )) ORDER BY HL7EventMessageTypes.message_typ_snd, HL7EventMessageTypes.event_code
